import React from "react";
import "./App.css";

function AdminFooter() {
  return (
    <div>
      <footer className="Adminfooter">
        <div className="foot">ADMIN DASHBOARD</div>
        <div className="foot">ONLY ADMIN CAN VIEW</div>
      </footer>
    </div>
  );
}

export default AdminFooter;
